INSERT INTO `Projects` (`id`, `title`, `description`, `shortDescription`, `vote`, `image`, `shortImage`, `github_link`, `project_link`, `userId`, `tagId`, `tag2Id`, `tag3Id`, `tag4Id`, `tag5Id`, `tag6Id`, `createdAt`, `updatedAt`) VALUES
('5', 'DeviensDev le site pour d√©couvrir les m√©tiers du d√©veloppement', '<h1>DeviensDev le site pour d√©couvrir les m√©tiers du d√©veloppement&nbsp;</h1><p><br></p><p>Deviens.dev est un projet open-source mijot√© par l\\\'√©cole O\\\'Clock !</p><p><br></p><p>Cr√©√© par des d√©veloppeurs,&nbsp;<strong>DeviensDev</strong>&nbsp;vous ouvre les portes du d√©veloppement web en mettant √† votre disposition toutes les cl√©s pour comprendre le m√©tier de d√©veloppeur, vous initier au code et vous orienter vers les formations ad√©quates.</p><p><br></p><p>La vocation commence par l‚Äôinformation. Le m√©tier de d√©veloppeur √©tant complexe, il est n√©cessaire de se documenter avant de s‚Äôy orienter. Pour ce faire, nous avons mis des fiches pratiques sur les comp√©tences et pr√©requis √† r√©unir, les diff√©rentes sp√©cialisations et les d√©bouch√©s que vous pouvez d√©couvrir ici :</p><p><br></p><p><a href=\\\"https://deviens.dev/metier-developpeur/\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">Le m√©tier de d√©veloppeur</a> | <a href=\\\"https://deviens.dev/metier-developpeur/cest-quoi-un-developpeur\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">C\\\'est quoi un d√©veloppeur</a> | <a href=\\\"https://deviens.dev/metier-developpeur/cest-quoi-un-developpeur/\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">Les sp√©cialisations du web</a></p><p><br></p><h2>Les mains dans le code</h2><p><br></p><p>Pour savoir si tu es fait pour devenir d√©veloppeur, il n‚Äôy a pas 36 solutions : il faut commencer √† coder ! Pour cela, nous avons pr√©par√© diff√©rents parcours d‚Äôinitiation √† arpenter pour se frotter aux langages web. HTML, CSS, PHP et bien d‚Äôautres technologies :</p><p><br></p><p><a href=\\\"https://deviens.dev/initiation\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">Initiation au code</a></p><p><br></p><h2>Veille technologique</h2><p><br></p><p>Nous avons cr√©√© une section d√©di√©e au contenu √©crit par des professionnels √† destination des lecteurs qui s‚Äôint√©ressent au d√©veloppement ou&nbsp;qui&nbsp;envisagent une reconversion au m√©tier de d√©veloppeur. C\\\'est <a href=\\\"https://deviens.dev/blog\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">le blog de Deviens.dev</a> ! Une section avec plein de conseils et tutos, des t√©moignages de d√©veloppeurs chevronn√©s qui souhaitent partager leur exp√©rience et aussi du contenu totalement inutile mais pourtant indispensable √† la compr√©hension de ce m√©tier.</p><p><br></p><h2>Contribution</h2><p><br></p><p><strong>DeviensDev est une plateforme d‚Äôinformation sur le m√©tier de d√©veloppeur.</strong></p><p>Elle repose int√©gralement sur un syst√®me de contribution. Ainsi, tous les professionnels du d√©veloppement qui souhaitent partager leurs connaissances, leur vision et leur passion du m√©tier sont invit√©s avec plaisir √† contribuer √† la plateforme. Si tu souhaites apporter ta pierre √† l‚Äô√©difice DeviensDev, tu peux √©crire un article qui sera publi√© sur le blog :&nbsp;<a href=\\\"https://deviens.dev/blog\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">Parlons Dev</a>&nbsp;! Pour ce faire, il y a quelques √©tapes √† respecter :</p><p><br></p><p><br></p><p>TU SOUHAITES PROPOSER UN ARTICLE ?</p><p><br></p><ul><li>Fork le d√©p√¥t&nbsp;<a href=\\\"https://github.com/O-clock-Alumni/DeviensDev\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\">GitHub</a></li><li>Cr√©e une branche et positionne-toi dessus</li><li>Cr√©e ton article dans&nbsp;content/blog/*, √† l‚Äôaide du fichier&nbsp;contributing.md</li><li>Cr√©e un fichier&nbsp;.json&nbsp;dans&nbsp;content/authors/*&nbsp;et ajoutes-y ton twitter et ta bio</li></ul><p><br></p><h3>Pour tester le rendu de ton article, en local :</h3><ul><li>yarn&nbsp;pour installer les d√©pendances n√©cessaires</li><li>yarn start&nbsp;pour lancer le site en local</li></ul><p><br></p><h3>Quand tout est OK :</h3><ul><li>On fait une relecture</li><li>On planifie la publication</li><li>On met en ligne l‚Äôarticle</li></ul><p><br></p><p><br></p><p>TU SOUHAITES CORRIGER UN ARTICLE&nbsp;?</p><p><br></p><p>Tu as le choix :</p><ul><li>Suivre la proc√©dure d√©crite dans ¬´&nbsp;Tu souhaites proposer un article&nbsp;¬ª</li><li>Le faire directement depuis l‚Äôinterface GitHub</li></ul><p><br></p><p>Si tu ne sais pas comment t‚Äôy prendre‚Ä¶</p><p>N‚Äôh√©site pas √† ouvrir une issue sur le d√©p√¥t GitHub, et notre √©quipe viendra te filer un coup de main.</p><p><br></p><p><a href=\\\"https://github.com/O-clock-Alumni/DeviensDev\\\" rel=\\\"noopener noreferrer\\\" target=\\\"_blank\\\"><strong>VOIR LE D√âP√îT</strong></a></p>', 'DeviensDev le site pour d√©couvrir les m√©tiers du d√©veloppement', '7', 'https://i.ibb.co/5cTqSkW/download-1.jpg', 'https://i.ibb.co/5cTqSkW/download-1.jpg', 'https://github.com/O-clock-Alumni/DeviensDev', 'https://deviens.dev/', '6', '1', '7', '47', NULL, NULL, NULL, '2020-12-20 23:49:38.000', '2021-01-05 15:13:30.751'),
('10', 'Bucket - L\'application pour suivre sa Bucket List et atteindre ses objectifs', '<p>Bucket est une belle application moderne qui vous aide √† suivre votre Bucket List, √† planifier la r√©solution de votre nouvelle ann√©e et √† atteindre vos objectifs.</p><p>Organisez votre liste de souhaits, atteignez vos objectifs, √©crivez vos histoires, gravez vos souvenirs et partagez-les avec vos amis.</p><p><br></p><iframe class=\"ql-video\" frameborder=\"0\" allowfullscreen=\"true\" src=\"https://www.youtube.com/embed/a3KfXPT90FA?showinfo=0\"></iframe><p><br></p><p>Nous sommes ravis de partager Bucket avec la communaut√©!</p><p>Bucket est une application de Bucket List moderne qui vous aide √† suivre votre liste, √† atteindre vos objectifs et √† graver vos souvenirs.</p><p><br></p><p>Nous nous effor√ßons de cr√©er l\'application qui vous aide √† vous concentrer sur ce qui compte vraiment pour vous personnellement et √† vous offrir la meilleure exp√©rience de suivi de votre liste.</p><p><br></p><p><img src=\"data:image/jpeg;base64,\"><img src=\"data:image/jpeg;base64,\"></p><p><br></p><h2>Cat√©gorie</h2><p><br></p><p>Vous pouvez cr√©er vos propres cat√©gories avec une couleur d\'arri√®re-plan personnalis√©e, quelques exemples ci-dessous:</p><p>- Jeux</p><p>- L\'amour</p><p>- Voyager √† travers le monde</p><p>- La vie</p><p>- 2021</p><p><br></p><h2>Votre Bucket List</h2><p><br></p><p>- Ajouter une bucket list √† chaque cat√©gorie avec l\'image et l\'histoire derri√®re</p><p>- √âpinglez les bucket list √† la page d\'accueil pour qu\'ils apparaissent dans le widget</p><p><br></p><h2>Statistiques</h2><p><br></p><p>- Suivez le nombre de seaux que vous avez atteints</p><p>- Affichez les informations derri√®re votre liste de seau.</p><p><br></p><p>Cela ne fait que commencer. D\'autres fonctionnalit√©s seront bient√¥t disponibles. Nous aimerions avoir vos commentaires et je serais heureux de r√©pondre √† toutes vos questions</p>', '', '6', 'https://i.imgur.com/z84X3Cg.png', NULL, '', 'https://apps.apple.com/us/app/bucket-achieve-your-goals/id1534447271', '12', '45', NULL, NULL, NULL, NULL, NULL, '2020-12-22 08:29:42.000', '2020-12-22 13:24:46.336');
