('14', 'Find my Star wars', '<h2>Qu\'est-ce que c\'est?</h2><p><br></p><p>Find my Star wars utilise <a href=\"https://swapi.dev/\" rel=\"noopener noreferrer\" target=\"_blank\"><em>Swapi</em></a><em> </em>(Swah-pee) qui est la premi√®re source de donn√©es quantifi√©e et accessible par programme au monde pour toutes les donn√©es de l\'univers canon de Star Wars!</p><p><br></p><p>Pour tout les grand fans, cela vous permet d\'acc√©der aux donn√©es de l\'univers de Star wars, rechercher les personnages, ou bien par plan√®tes, vaisseaux etc...</p><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><p><br></p><p><br></p><p>C\'est un bon exercice pour se confronter √† Javascript, faire des appels Api, et utiliser du Css. L\'utilisation de la pagination pour afficher une grosse quantit√© de donn√©es est indispensable, et tr√®s int√©rressante √† mettre en place!</p>', '', '4', 'https://i.imgur.com/cg8hsMM.png', NULL, 'https://github.com/JordanSuarez', '', '3', '1', '2', '51', NULL, NULL, NULL, '2020-12-22 09:52:10.000', '2020-12-22 13:17:29.238');
