('15', 'Histoires de no√´l', '<p>Retrouvez toutes les belles histoires et traditions de No√´l et de Saint Nicolas, celles qui ont berc√© notre enfance et celles que nous avons oubli√©es. Les origines et l\'histoire de la cr√®che, l\'histoire de la b√ªche, l\'histoire du sapin de No√´l et des boules de No√´l.</p><p>&nbsp;</p>', '', '5', 'https://image.freepik.com/vecteurs-libre/page-destination-design-noel_23-2148323862.jpg', NULL, '', '', '1', '1', '7', '8', '15', '20', '23', '2020-12-22 10:17:12.000', '2020-12-22 16:25:59.000'),
('16', 'Todolist', '<p>Une TODO list est un excellent projet pour commencer √† se familiariser avec l‚Äôentr√©e de donn√©es et son affichage. En faisant une todo list, vous apprendrez, par exemple :</p><ul><li>Comment g√©rer et afficher diff√©rents elements en fonction de leur √©tat</li></ul><p><img src=\"data:image/png;base64,\"></p><ul><li>Comment cr√©er, r√©cup√©rer, modifier et supprimer des objets en javascript</li></ul><p><img src=\"data:image/png;base64,\"></p><ul><li>Comment aller plus loin avec de la permanence de data localement en explorant&nbsp;localStorage</li></ul><p><br></p><p>Une TODO liste est un projet qui sera souvent repris en exemple quand vous apprendrez des frameworks ou libraires telles que&nbsp;react,&nbsp;react-native,&nbsp;vue.js,&nbsp;angular.js&nbsp;et d‚Äôautres. Faire ce projet en JS Vanilla et HTML a donc beaucoup de sens et facilitera votre apprentissage dans le futur.</p>', '', '2', 'https://image.noelshack.com/fichiers/2020/52/2/1608643060-download-1.png', NULL, 'https://github.com/JordanSuarez', '', '3', '1', '2', NULL, NULL, NULL, NULL, '2020-12-22 10:17:29.000', '2020-12-23 17:13:14.000'),
('18', 'Cook Me', '<p>L‚Äôaventure de la cr√©ation d\'une recette et du partage.</p><p>Cook me est un projet en cour de d√©veloppment qui permettra √† terme de cr√©er, partager, liker des recettes...</p>', '', '5', 'https://image.noelshack.com/fichiers/2020/52/2/1608643136-download.jpeg', NULL, '', '', '3', '7', '26', '50', '17', NULL, NULL, '2020-12-22 10:31:22.000', '2020-12-22 13:20:10.742'),
('19', 'Ma belle poissonnerie ', '<p>Parce que je mange des poulpes √† longueur de journ√©e</p>', '', '4', 'https://www.delicieuxsecret.com/images/272/p/272_264697_m3.jpg', NULL, '', '', '11', '34', '23', '5', NULL, NULL, NULL, '2020-12-22 10:53:59.000', '2020-12-22 13:34:37.660'),
('20', 'A la chocolatine !', '<p><strong>Chocolatine</strong> ou pain au chocolat ? C‚Äôest l‚Äô√©ternel d√©bat, et nous avons la r√©ponse !&nbsp;</p><p>Boulangerie au c≈ìur de Toulouse !</p><p>Pour un grand repas, pensez √† commander votre pain et vos viennoiseries en&nbsp;<strong>ligne</strong>&nbsp;!</p>', '', '5', 'https://static.thiriet.com/data/common_public/gallery_images/site/18756/18774/108662,8_pains_au_chocolat_pur_beurre.jpg', NULL, '', '', '1', '26', '17', '46', '1', NULL, NULL, '2020-12-22 10:54:33.000', '2020-12-22 13:16:04.208'),
('21', 'PassionCharcut - Le site des passionn√©s du gras et de la charcuterie', '<h1>Le site des passionn√©s du gras et de la charcuterie</h1><p><br></p><p>Parce que le gras c\'est la vie, nous avons d√©cid√© de r√©unir tous les passionn√©s de charcut\' sur un m√™me site ! Parlons peu mais parlons saucisson !</p><p><br></p><p><img src=\"data:application/octet-stream;base64,\"></p>', '', '6', 'https://i.ibb.co/wpqGdSS/le-gras-c-est-la-vie.jpg', NULL, 'https://github.com/', '', '15', '3', '6', NULL, NULL, NULL, NULL, '2020-12-22 10:59:42.000', '2021-01-14 13:36:10.000'),
('22', 'O\' blagues d\' Alban !', '<p>Retrouvez les blagues les plus dr√¥les, marrantes d\' Alban. Tous les jours d√©couvrez de nouvelles blagues ! Plus d\'une centaine de blagues vous attendent pour tous les go√ªts !</p><p><br></p>', '', '6', 'https://i.ibb.co/dPdxcgk/t-l-chargement.png', NULL, '', '', '1', '19', '7', '8', NULL, NULL, NULL, '2020-12-22 10:59:48.000', '2020-12-22 13:45:07.611'),
('24', 'Tarti-Party - La f√™te oui ! Mais pas sans tartiflette !', '<h1>Tarti-Party - La f√™te oui ! Mais pas sans tartiflette !</h1><p>jbhbb</p>', '', '6', 'https://i.ibb.co/ZBW4qKJ/t-l-chargement.jpg', NULL, 'https://github.com/', '', '5', '2', '8', NULL, NULL, NULL, NULL, '2020-12-22 11:09:05.000', '2021-01-14 13:36:08.000'),
('26', 'Graphist - Site de partage de croquis', '<p>Un site&nbsp;qui permet de cr√©er des dessins du bout de la souris et de les partager.</p>', '', '6', 'https://i.ibb.co/njp8Y8L/graph.jpg', NULL, '', '', '17', '1', '3', '2', NULL, NULL, NULL, '2020-12-22 11:14:19.000', '2020-12-22 14:23:43.000'),
('31', 'O\'Lobby', '<p>Le matchmaking des jeux vid√©os (Fortnite, COD, Apex Legends, GTA, etc.) en r√©seau sur les plateformes Playstation, Xbox, PC peut g√¢cher l\'exp√©rience des utilisateurs de ces jeux et ils ressortent de sessions de parties d√©√ßus du comportement des autres participants (abandon en cours de jeu, incivisme, non-collaboration), regrettent la non-√©quivalence de niveau, sans oublier la barri√®re de la langue.</p><p><strong>O‚ÄôLobby</strong> est un r√©seau social destin√© aux joueurs avec peu de relation ou cherchant une meilleure exp√©rience de jeu en trouvant des joueurs qui correspondent √† leurs crit√®res. Le joueur pourra se constituer un carnet de profils de joueur plus rapidement qu\'en les trouvant seulement en partie et dans son entourage proche.</p>', '', '3', 'https://i.ibb.co/nBDtTfP/download-2.png', NULL, '', '', '22', '7', '26', NULL, NULL, NULL, NULL, '2020-12-22 12:44:00.000', '2020-12-22 14:23:40.000');
